import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products page!</h1>
      <ul>
        <Link>Product 1</Link>
        <Link>Product 2</Link>
        <Link>Product 3</Link>
      </ul>
    </section>
  );
};

export default Products;
